import React from 'react';
import { View, Text, TouchableOpacity } from 'react-native';

import styles from './styles';

const BottomButton = ({
  onPress,
  text,
  containerReplace,
  buttonTouchReplace,
  buttonTextReplace,
}) => {
  return (
    <View style={containerReplace || styles.container}>
      <TouchableOpacity
        onPress={onPress}
        style={buttonTouchReplace || styles.buttonTouch}
      >
        <Text style={buttonTextReplace || styles.buttonText}>{text}</Text>
      </TouchableOpacity>
    </View>
  );
};

export default BottomButton;
